import React from "react";
import "./index.css";
import HTML from './HTML.png'
import CSS from './image.png'

const Skills = () => {
  return (
    <>
      <div className="cotainer d-flex">
        <img className="btn logo" src={HTML} alt="" />
        <img className="btn logo" src={CSS} alt="" />
      </div>
    </>
  );
};

export default Skills;
